gU3(){return"In the PPPP-model (People-Private-Public-Partnership) of financing, private individuals, the public sector and companies jointly raise the necessary amount of money. The funds are used to purchase a certain number of PV systems, of which some percentages are owned by private individuals and the remainder by companies. The income from the various PV systems will be divided proportionally among the shareholders, depending on the percentage they have contributed to the crowdfunding. With this joint ownership the responsibility of maintenance is also shared. The owners will receive consistent proportional payments from the profits of the generated power."},
gU4(){return"In this financing form, private individuals and the public sector jointly raise a certain amount of money. This money is used to purchase a certain amount of PV systems, which are 100% owned by the private individuals. The income from the various PV systems will be divided proportionally among the people, depending on the percentage they have contributed to the crowdfunding. \u200b"},
gU5(){return"Within the leasing model, consumers agree on a service contract with a service provider. This company provides all the technology, including installation. They are also responsible for the entire operation. However, the company owns all the equipment. Customers pay a constant monthly amount to the company. The entire financial risk and operational risk lies with the service provider.\u200b"},
gU6(){return"A major barrier preventing the extensive installation of solar panels in the M\xf8llenberg area is funding. The financial load may be distributed on several shoulders. In the following models, various solutions are explained more closely. The public and private sectors should not be addressed via a case-by-case approach, but should be addressed directly via a top-down approach across the entire site. The possible funding approaches for this are now presented. "},
