gIa(){return"With increased housing prices and lower purchasing power fewer resident can afford to become self-owners. This also excludes a high portion of the population from the economic growth in the real estate market. This issue is not unique for Norway but is a central issue in many parts of the world. The effect of this could be increased dividing of class and wealth. M\xf8llenberg is one of the most active and vibrant communities in Trondheim."},
