gIb(){return"Cell Types"},
gIc(){return"There are three main cell-types, Monocrystalline, Polycrystalline and Thin-film."},
gId(){return" Monocrystalline cells can be identified by their wafer shape and black or grey colouring. With 16 to 24%, they achieve the highest efficiency. However, due to their complex manufacturing process, they are also the most expensive."},
gIe(){return"Polycrystalline cells are not made from a homogeneous ingot, and they are cheaper than monocrystalline ones. However, the less perfect crystal structure lowers the efficiency of polycrystalline modules to about 14 to 18%. They can be recognised by the shiny blue colour of the Wafers."},
gIf(){return"Thin-film cells can be made from photoactive semiconductor materials like amorphous-based silicon (a-Si), cadmium telluride (CdTe), or copper indium diselenide (CIS). A very thin layer of those materials is applied to a low-cost substrate (f. ex. glass, metal, or plastic). Thin-film cells can be bend and in comparison, to monocrystalline and polycrystalline cells they are not cut into wafers. This gives more possibilities in shape and dimension and allows creative usage in architecture. Moreover, the cells efficiency is less dependent on the surroundings temperature. The downsides of thin-film cells are a toxic manufacturing process and a lower efficiency. The efficiency varies between 4 to 10 %."},
gAw(){return"Coloured PV"},
gIg(){return"One way to integrate PV modules into the building envelope in a visually appealing way is to use coloured modules. The main areas of application are fa\xe7ades and roofs, where the modules can either be inserted as inconspicuously as possible into the existing structures or deliberately used as an architectural design element. In this way, they offer the opportunity to increase the acceptance of PV in heritage areas such as M\xf8llenberg. "},
gIh(){return"To add colour to a black PV module, part of the incident light must be reflected by the module. This means that fewer photons are available to generate electricity, which lowers the efficiency of the panels. There are different ways to colour PV modules. One of the most common techniques is the use of single and multilayer films that reflect certain wavelengths of visible light due to interference and thereby create a colour. Other possibilities are to print pigments on the cover glass or to influence the scattering and absorption. "},
gIi(){return"To compare the efficiency of different colour shades, they must have the same luminosity. The reason for this is that brighter colours lead to a higher reflectance, which increases the relative loss of the modules. Researchers have found that yellow-green colours can achieve the highest efficiencies. This is because the human eye is particularly sensitive to the corresponding wavelengths and thus fewer photons need to be reflected for colouring. Nevertheless, a theoretical efficiency of more than 29% is possible for all sRGB colours if they have a relatively low luminosity."},
gIj(){return"Photovoltaic (PV) cells are devices that can convert solar radiation into direct current. The performance of PV modules depends on several factors. These include the size, material, and electrical efficiency of the solar cells. In addition, climatic conditions also play an important role, as cloudiness and high temperatures lead to a reduction in the power output."},
gAx(){return"Solar Roof Tiles"},
gIk(){return"Solar roof tiles can be used as a substitute for normal roof tiles and are therefore particularly suitable for new roof construction or roof renovation. There are solar roof tiles with different shapes, colours, and PV technologies. Mono- or polycrystalline cells can be incorporated into the tile, as well as thin film technologies can be applied to the tiles. The usual efficiencies are in the range of 10 to 15%."},
gvs(){return"Transparent PV"},
gIl(){return"In recent years, research has been conducted into the development of transparent solar cells. These offer the possibility to use glass surfaces for electricity generation. Especially for buildings with large glass facades, the solar cells can enable the buildings to generate more than 40% of their energy consumption themselves. However, the transparency is currently still associated with losses in efficiency, which is why they cannot yet compete with conventional silicon modules. The difficulty in manufacturing transparent solar cells is to enable the transmission of visible light while absorbing photons in the range of non-visible wavelengths. Most technologies for the production of transparent solar cells are based on thin film PV. For this purpose, a layer of a semiconductor less than 20 nm thick is deposited on glass. This reduces the transparency of the glass by at least 20%. Efficiencies range from 1% to 10% depending on transparency and manufacturing process."},
gIm(){return"Bakkegata mainly consist of residential buildings. The amount of space between the different buildings is limited, and as a result many of the walls are not exposed to sunlight even on summer solstice. However, the DSH also shows that a couple of the roof surfaces experience 14-20 direct sun hours during the same period."},
gIn(){return"Bispehaugen is an elementary school surrounded by open space. Because of this the building receives a fair amount of sunlight both on the walls 10-12 hours and the roof 14-20 hours. On the north/western part of the chosen area lies a residential complex which also receives upwards of 20 direct sun hours, primarily due to being located next to Thorn\xe6s park."},
gIo(){return"Direct Sun Hours M\xf8llenberg"},
gIp(){return"\xd8vre M\xf8llenberg is situated in the southernmost part of the district. Next to the neighbourhood is a large park containing Kristiansten fort. There is open terrain east of the neighbourhood, which probably positively effects the sun exposure. Consisting mainly of single-building homes, most of the structures receive a significant amount of sun hours especially on the roofs, ranging from 14-20 hours, and on the walls 0-12 hours."},
gIq(){return"Results of the simulation shows that the exposure on M\xf8llenberg varies from 20 hours at most during summer to 4 hours during the winter. Sun hours distribution is even throughout the district, with a couple of outliers, towards the southern part of the district."},
gIr(){return"Rosenborg gate is in the northern part of M\xf8llenberg and seems to share its attributes with the area Bakkegata. The walls seem to receive little to no sunlight, whilst some of the roof surfaces get 20 hours of direct sunlight during the summer solstice."},
gIs(){return"Solar Radiation and Irradiance"},
gIt(){return"Photovoltaic (PV) systems convert irradiance into useable electricity. Irradiance is a term used to describe the strength of the electromagnetic radiation a surface receives. The primary factor determining the irradiance strength is the radiations angle of impact with a surface. If a ray hits a surface with an incident angle of 90 degrees, the  impact yields the maximum amount of energy. Likewise, if the incident angle is very sharp the sunray will reflect of the surface, and therefore yield less energy (CE, u.d.)."},
