gDS(){return"Om applikasjonen"},
gPE(){return"Hvis du har flere sp\xf8rsm\xe5l, vennligst kontakt:"},
gDT(){return"Om Helios"},
gPF(){return"Denne applikasjonen er utviklet som en del av en masteroppgave ved NTNU. M\xe5let med oppgaven er \xe5 forske p\xe5 effekten av digital teknologi i en prosess for innbyggerengasjement. Innbyggerengasjement er en demokratisk prosess der myndigheter eller prosjekteiere deler informasjon knyttet til et prosjekt eller teknologier, med m\xe5l om \xe5 \xf8ke kunnskapen til innbyggerne og samle tilbakemeldinger med innbyggers unike perspektiv. Dette prosjektet bruker informasjon produsert av Helios om solcelleteknologi og retter seg mot innbyggere i M\xf8llenberg."},
gPG(){return"Helios er et prosjekt drevet av NTNUs ingeni\xf8rfakultet. M\xe5let med prosjektet er \xe5 forbedre optimal utnyttelse av solenergi i nordiske byer gjennom digitalisering av det bygde milj\xf8et. Det historiske omr\xe5det M\xf8llenberg er et spesielt fokus for forskning. Dette fordi kulturarvbygningene introduserer unike utfordringer knyttet til b\xe6rekraftig bevaring og utvikling av historiske omr\xe5der."},
